window.bookSummaryJSON = "<p>Val thought it was over, having gambled with fate itself for the lives of all those he loved.<br> &nbsp;</p> <p>He did not expect to wake up in a hospital bed, in the crosshairs of a professional killer.<br> &nbsp;</p> <p>A friend he thought lost forever shows him a mysterious game that only a select few can jack into. It's the perfect escape, and what seems a fun lark becomes all too real as he enters a realm where level-ups affect both worlds, dying in game is dying for real, and no one is hungrier for Val's secrets then the men hunting for his head.<br> &nbsp;</p> <p>Time is running out for Val and everyone he loves. <br> &nbsp;</p> <p>So much for happy endings.</p>"; 
